package week15import java.io.BufferedReaderimport java.io.InputStreamReaderfun main() {    val br = BufferedReader(InputStreamReader(System.`in`))    val (W, P) = br.readLine().split(" ").map { it.toInt() }    val partitions = br.readLine().split(" ").map { it.toInt() }.toMutableList()    partitions.add(0)    partitions.add(W)    partitions.sort()    var ans = mutableSetOf<Int>()    for (i in partitions.indices) {        for (j in i+1 until partitions.size) {            ans.add(partitions[j] - partitions[i])        }    }    val sortedAns = ans.toList().sorted().joinToString(" ")    println(sortedAns)}